   * Default: 250
   */
  pageDelta?: number;

  /**
   * The delta value for the space key
   * Default: 150
   */
  spaceDelta?: number;

  /**
   * The delta value for home and end
   * Default: Infinity
   */
  homeEndDelta?: number;
}

const defaultConfig = {
  passive: false,
  target: Browser.client ? document.documentElement : undefined,
  eventName: 'keydown',
  arrowDelta: 100,
  pageDelta: 250,
  spaceDelta: 200,
  homeEndDelta: Infinity
};

